La fonction main est le point d'entrée des programmes en C. Une fonction est une zone qui contient du code. Tu pourras créer tes propres fonctions plus tard, que tu pourras appeler depuis la fonction main. Pour l'instant, voici ce que tu as : int main(void)
{ return 0;
} Décortiquons tout ça. int signifie que la fonction retourne un int eger, c'est à dire un entier. C'est effectivement le cas avec le return 0 dans le code. Tu retournes la valeur 0 dans le shell comme exit status . void veut dire que la fonction ne prend pas de paramètres. Donc tu ne peux pas envoyer de paramètre à l'exécution de ton programme, à l'inverse de programmes que tu as déjà utilisés comme ls , echo , mkdir , etc. Tu verras juste après comment faire. Change le 0 par un 42, compile ton programme, et exécute le. Tu verras que tu auras un exit status à 42. int main(void)
{ return 42;
} $ gcc test.c -o mon_super_programme
$ ./mon_super_programme
$ echo $?
42
$ Tu comprends mieux maintenant comment les programmes que tu sais utiliser te renvoient des exit status maintenant.
